/**
* 提供工具的模块
* @class Util
* @static
**/
var misc = {
	/**
	* 获取URL参数
	* @method getParam
	* @param {String} key
	* @param {String{ type 参数的类型，‘hash’或者‘search’
	* @return {String} 返回key对应的URL参数的值
	**/
	getParam: function(key, type){
		var type = type || 'search', str, arr;
		switch(type){
			case 'hash':
				str = location.hash.replace(/^#/, '');
			break;
			case 'search':
				str = location.search.replace(/^\?/, '');
			break;
		}
		if(str == ''){
			return null;
		}
		arr = str.split('&');
		for(var i = 0, l = arr.length, tmp; i < l; i ++){
			tmp = arr[i].split('=');
			if(tmp[0] == key){
				return tmp[1];
			}
		}
	},
	//判断是否是整数
  	isInteger : function(num){
		var patrn=/^[0-9]*[1-9][0-9]*$/;
		if (!patrn.exec(num)){
			return false;
		}
		return true;
	},
	//返回格式化时间String（例如：yyyy-MM-dd）
	formatDateTime : function(date,fmt){
		var o = {
    		"M+": date.getMonth() + 1, //月份
    		"d+": date.getDate(), //日
    		"h+": date.getHours(), //小时
    		"m+": date.getMinutes(), //分
    		"s+": date.getSeconds(), //秒
   			"q+": Math.floor((date.getMonth() + 3) / 3), //季度
    		"S": date.getMilliseconds() //毫秒
		};
		if (/(y+)/.test(fmt)) fmt = fmt.replace(RegExp.$1, (date.getFullYear() + "").substr(4 - RegExp.$1.length));
		for (var k in o)
			if (new RegExp("(" + k + ")").test(fmt)) fmt = fmt.replace(RegExp.$1, (RegExp.$1.length == 1) ? (o[k]) : (("00" + o[k]).substr(("" + o[k]).length)));
		return fmt;
	}
};
